0),(51,'Taxonomy Template','','default',0),(52,'Category Template','','default',0),(53,'Tag Template','','default',0),(54,'Posts Page','','default',0),(55,'Search Results','','default',0),(56,'Date Template','','default',0),(57,'Singular Template','','default',0),(58,'Single Post','','default',0),(59,'Single Page','','default',0),(60,'Homepage','','default',0),(61,'Privacy Policy Page','','default',0),(62,'Attachment Template','','default',0),(63,'Image Attachment Template','','default',0),(64,'Video Attachment Template','','default',0),(65,'Audio Attachment Template','','default',0),(66,'Application Attachment Template','','default',0),(67,'Embed Template','','default',0),(68,'Embed 404 Template','','default',0),(69,'Embed Content Template','','default',0),(70,'Embed Header Template','','default',0),(71,'Embed Footer Template','','default',0),(72,'Stylesheet','','default',0),(73,'Visual Editor Stylesheet','','default',0),(74,'Visual Editor RTL Stylesheet','','default',0),(75,'RTL Stylesheet','','default',0),(76,'my-hacks.php (legacy hacks support)','','default',0),(77,'.htaccess (for rewrite rules )','','default',0),(78,'Comments Template','','default',0),(79,'Popup Comments Template','','default',0),(80,'Popup Comments','','default',0),(81,'Default','','default',0),(82,'Light','','default',0),(83,'Blue','','default',0),(84,'Midnight','','default',0),(85,'Sunrise','','default',0),(86,'Ectoplasm','','default',0),(87,'Ocean','','default',0),(88,'Coffee','','default',0),(89,'Add Accordion','','wpsm_accordion',0),(90,'Accordion Shortcode','','wpsm_accordion',0),(91,'Support & Docs','','wpsm_accordion',0),(92,'BLACK FRIDAY DEAL','','wpsm_accordion',0),(93,'Rate Us If You Like This Plugin','','wpsm_accordion',0),(94,'Accordion Settings','','wpsm_accordion',0),(95,'More Free Plugins From Wpshopmart','','wpsm_accordion',0),(96,'MOre Pro Plugins From Wpshopmart','','wpsm_accordion',0),(97,'Suggested text:','','default',0),(98,'Who we are','','default',0),(99,'In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.','','default',0),(100,'The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.','','default',0),(101,'Our website address is: %s.','','default',0),(102,'What personal data we collect and why we collect it','','default',0),(103,'In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.','','default',0),(104,'You should also note any collection and retention of sensitive personal data, such as data concerning health.','','default',0),(105,'In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.','','default',0),(106,'Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.','','default',0),(107,'By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.','','default',0),(108,'In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.','','default',0),(109,'When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.','','default',0),(110,'An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.','','default',0),(111,'Media','','default',0),(112,'In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.','','default',0),(113,'If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.','','default',0),(114,'Contact forms','','default',0),(115,'By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.','','default',0),(116,'Cookies','','default',0),(117,'In this subsection you should list the cookies your web site uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.','','default',0),(118,'If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.','','default',0),(119,'If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.','','default',0),(120,'When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.','','default',0),(121,'If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.','','default',0),(122,'Embedded content from other websites','','default',0),(123,'Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.','','default',0),(124,'These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.','','default',0),(125,'Analytics','','default',0),(126,'In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.','','default',0),(127,'By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.','','default',0),(128,'Who we share your data with','','default',0),(129,'In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.','','default',0),(130,'By default WordPress does not share any personal data with anyone.','','default',0),(131,'How long we retain your data','','default',0),(132,'In this section you should explain how long you retain personal data collected or processed by the web site. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.','','default',0),(133,'If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.','','default',0),(134,'For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.','','default',0),(135,'What rights you have over your data','','default',0),(136,'In this section you should explain what rights your users have over their data and how they can invoke those rights.','','default',0),(137,'If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.','','default',0),(138,'Where we send your data','','default',0),(139,'In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.','','default',0),(140,'European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.','','default',0),(141,'Visitor comments may be checked through an automated spam detection service.','','default',0),(142,'Your contact information','','default',0),(143,'In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.','','default',0),(144,'Additional information','','default',0),(145,'If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.','','default',0),(146,'How we protect your data','','default',0),(147,'In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.','','default',0),(148,'What data breach procedures we have in place','','default',0),(149,'In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.','','default',0),(150,'What third parties we receive data from','','default',0),(151,'If your web site receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.','','default',0),(152,'What automated decision making and/or profiling we do with user data','','default',0),(153,'If your web site provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.','','default',0),(154,'Industry regulatory disclosure requirements','','default',0),(155,'If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.','','default',0),(156,'WordPress','','default',0),(157,'WordPress &rsaquo; Error','','default',0),(158,'%d Plugin Updates','','default',0),(159,'The post type %1$s is not registered, so it may not be reliable to check the capability \"%2$s\" against a post of that type.','','default',0),(160,'Link to %s','','default',0),(161,'Duplicate This as draft','','duplicate-page',0),(162,'words','','default',0),(163,'\'tain\'t,\'twere,\'twas,\'tis,\'twill,\'til,\'bout,\'nuff,\'round,\'cause,\'em','','default',0),(164,'&#8217;tain&#8217;t,&#8217;twere,&#8217;twas,&#8217;tis,&#8217;twill,&#8217;til,&#8217;bout,&#8217;nuff,&#8217;round,&#8217;cause,&#8217;em','','default',0);
